http://en.wikipedia.org/wiki/Coachella_Festival_line-ups

"Coachella showcases popular and established musical artists, as well as emerging artists and reunited groups. Notable appearances in the past include: AC/DC, Amy Winehouse, Dr. Dre and Snoop Dogg, Prince, Paul McCartney, Arcade Fire, Wu-Tang Clan, The Killers, Radiohead, Daft Punk, Madonna, The Cure, Kanye West, Eminem, Gorillaz, The Black Keys, Rage Against the Machine, Beck, Nine Inch Nails, The Strokes, The White Stripes, Jay-Z, Beastie Boys, Muse, Red Hot Chili Peppers, and Foo Fighters. Coachella is one of the largest, most famous, and most profitable music festivals in the United States. In 2014, the festival tallied an aggregate attendance of 579,000 over six days and grossed a record-breaking $78.3 million"

@Soviet Potato¬†ugh, so smug, he's the first idiot i thought of...the wombats...better? you use linux, don't you?

if you don't think it's a shame that, bieber is selling out huge shows in huge stadiums around the world while better "indie" artists don't, then I don't get you. Point is arcade fire is as good as they've ever been...their fame doesn't make them less likable unless you're a hipster and that is what turns you off on them. Saying they've become more pretentious=more popular (right that isn't the dictionary meaning of pretentious but we know what you mean)=you're a hipster.

i've always liked indie artists better, but it used to be that the mainstream wasn't horrible. now it just is. you should embrace the few good mainstream ones there are.

