@Andrew Bature
not really sure what the difference is. are you insinuating i would actually pretend to like something that i don't enjoy listening to for the sake of supporting the band? because no one actually does that. i'm saying that the dude i replied to can't just say "if you like arcade fire, you have to like this other crap i listen to because i think they play better"

and yeah, who they are does affect how much i'll like the albums they release. that doesn't mean i'm going to sit through stuff that sounds bad to me, but i do enjoy the music more than i would if they weren't the people they are. i think that's pretty normal. a band isn't just music, it's a group of performers and human beings.
